.userBehaviorLog {
  height: calc(100vh - 135px);
  background: #fff;
  margin: 0 16px 16px 16px;
  padding: 16px;
  border-radius: 8px;
  overflow: hidden;
  position: relative;
  .condition {
    .el-button {
      border-radius: 6px;
      background: #84C22E;
      color: #fff;
      margin: 0;
    }
    .el-row {
      /*margin-bottom: 20px;*/
      &:last-child {
        margin-bottom: 0;
      }
    }
    .el-col {
      border-radius: 4px;
    }
  }

  .content{
    .el-button {
      margin: 0;
    }
    .el-button--text{
      color: #0825f3;
    }
  }
  // 表格
  .el-table {
    margin-top: 1px;
  }
  @import "./style.scss";
  // 分页
  .pagination {
    position: absolute;
    bottom: 5px;
    right: 20px;
    height: 64px;
    display: flex;
    align-items: center;
    flex-direction: row-reverse;
    .el-pagination {
      margin: 0;
    }
  }

}
